                      // <li>My Favorites</li>
                      //{" "}
                    </Link>
                    //{" "}
                    <Link to="/my_rated">
                      // <li>My Rated</li>
                      //{" "}
                    </Link>
                    //{" "}
                    <Link to="/ham">
                      // <li>Hamburger</li>
                      //{" "}
                    </Link>
                    //{" "}
                  </ul>
                  {/* //             <MDBNavItem active>
      //               <MDBNavLink to="/about">About</MDBNavLink>
      //             </MDBNavItem>
      //             <MDBNavItem>
      //               <MDBNavLink to="/discover">Discover</MDBNavLink>
      //             </MDBNavItem>
      //             <MDBNavItem>
      //               <MDBNavLink to="#!">Profile</MDBNavLink>
      //             </MDBNavItem> */}
                  //{" "}
